import { Button, TextField } from "@mui/material";
import React from "react";
import { Autocomplete } from "@mui/material";
import Box from "@mui/material/Box";

const Test = () => {
  const filmler = [
    { label: "The Shawshank Redemption", year: 1994 },
    { label: "The Godfather", year: 1972 },
    { label: "azat", year: 1972 },
    { label: "The Godfather: Part II", year: 1974 },
  ];

  const hello = (selam) => {
    console.log(selam);
  };
  return (
    <>
      <div>
        <Button onClick={hello("nas覺ls覺n")} variant="contained">
          Hello world
        </Button>
      </div>

      <div>
        <Autocomplete
          disablePortal
          options={filmler}
          sx={{ width: 300 }}
          renderInput={(params) => (
            <TextField {...params} label="Movie" helperText />
          )}
        />
      </div>

      <div>
        <TextField label="azat" />
      </div>

      <div>
        <Box
          component="form"
          sx={{ "& > :not(style)": { m: 1, width: "25ch" } }}
          noValidate
          autoComplete="off"
        >
          <TextField
            id="standard-basic"
            label="pasword"
            variant="standard"
            error
          />
        </Box>
      </div>
    </>
  );
};

export default Test;
